import React from 'react'
import Quiz from './Quiz'

const QuizPage = () => {

    

    

  return (
    <div className='quiz-container'>
        <h1 className='question'>Quiz</h1>
        <Quiz />
        <button onClick={Quiz.fetchQuestion()}>Next Question</button>
    </div>
  )
}

export default QuizPage
